import Logo from './Logo'

class Sidepanel extends React.Component {
    render(){
        return (
            <div className="col-md-3">
                <Logo />
                <div className="side-nav">
                    <ul className="nav flex-column">
                        <li className="nav-item">
                            <a className="nav-link active" href="#">Home</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">About</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Projects</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Blog</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Experience</a>
                        </li>
                    </ul>
                    <div className="contact">
                    <a href="https://www.linkedin.com/in/jai-parakh-5626b4178/" target="_blank">
                        <i className="fa fa-linkedin fa-3x" aria-hidden="true"></i>
                    </a>
                    <a href="https://github.com/JaiParakh" target="_blank">
                        <i className="fa fa-twitter fa-3x" aria-hidden="true"></i>
                    </a>
                    <a href="https://github.com/JaiParakh" target="_blank">
                        <i className="fa fa-github fa-3x" aria-hidden="true"></i>
                    </a>
                    <a href="https://medium.com/@parakh.js" target="_blank">
                        <i className="fa fa-medium fa-3x" aria-hidden="true"></i>
                    </a>
                    <a href="https://mail.google.com/mail/u/0/?view=cm&fs=1&to=contact.jaiparakh@gmail.com&tf=1" target="_blank">
                        <i className="fa fa-envelope fa-3x" aria-hidden="true"></i>
                    </a>
                    </div>
                </div>
                
            
            
            <style jsx>{`
            .nav{
                border-bottom: 2px solid #fff;
            }
            .nav-item{
                font-size: 1.5em;
                color: #fff !important;
                text-decoration: none;
            }
            li, a{
                color: #fff !important;
                text-decoration: none;
            }
            .col-md-3{
                border-right: 2px solid #fff;
                padding-right: 0px !important;
            }
        `}</style>
            </div>
        );
    }
}

export default Sidepanel;
